C
C  This module contains 16 BLOCK DATA statements that include the 
C  absorption coefficients and other data for each of the 16 longwave
C  spectral bands used in RRTM.  Here, the data are defined for 16
C  g-points, or sub-intervals, per band.  These data are combined and
C  weighted using a mapping procedure in routine RRTMINIT to reduce
C  the total number of g-points from 256 to 140 for use in the GCM.
C **************************************************************************

       BLOCK DATA KGB1

       PARAMETER (MG=16)
       REAL KA(5,13,MG), KB(5,13:59,MG)
       DIMENSION SELFREF(10,MG), FORREF(4,MG)
