       COMMON /K1/ KA ,KB, FORREF, SELFREF, KA_MN2, KB_MN2

C       COMMON /CVRSN/ HNAMKG,HVRKG
C       CHARACTER*18   HNAMKG,HVRKG
C       DATA HVRKG /'$Revision$'/

